import React from 'react'
import Ddata from "./Ddata"

const Dcard = () => {
  return (
    <>
        {
            Ddata.map((value,index) => {
                return (
                    <div className="box product" key={index}>
                        <div className="img">
                            <img src={value.cover} alt="" />
                        </div>
                        <h4>{value.name}</h4>
                        <span>{value.price}</span>
                    </div>
                )
            })
        }
    </>
  )
}

export default Dcard
